import { ICommandBarProps as IFabricCommandBarProps } from '@fluentui/react/lib/CommandBar';
import { ISearchBoxProps } from '@fluentui/react/lib/SearchBox';
export interface ICommandBarWithSearchBoxProps extends IFabricCommandBarProps {
    /**
     * The class name for the wrapper CommandBar component.
     * The className property gets passed down to the CommandBar component.
     * @type {string}
     */
    wrapperClassName?: string;
    /**
     * The properties to pass into the SearchBox.
     * @defaultValue null
     * @type {ISearchBoxProps}
     */
    searchBoxProps?: ISearchBoxProps;
    /**
     * Adds debouncing to the onChange function of the SearchBox in ms.
     */
    onChangeDelay?: number;
    /**
     * Whether or not the SearchBox is visible.
     * @defaultvalue false
     */
    isSearchBoxVisible?: boolean;
}
